import React from 'react';
import { Paper, Typography, Button, Box } from '@mui/material';

const SleepTracking = () => {
  return (
    <Paper elevation={3} sx={{ p: 3, height: '300px', display: 'flex', flexDirection: 'column', justifyContent: 'space-between' }}>
      <Typography variant="h5">Personal sleep tracking</Typography>
      <Box sx={{ flexGrow: 1, display: 'flex', alignItems: 'center', justifyContent: 'center' }}>
        {/* Replace with actual sleep tracking visualization */}
        <Box sx={{ width: 150, height: 150, bgcolor: 'secondary.main', borderRadius: '50%' }} />
      </Box>
      <Button variant="contained" fullWidth>Download app</Button>
    </Paper>
  );
};

export default SleepTracking;
